import { Outlet } from "react-router-dom";
import { SidebarLeft, SidebarRight } from "../../components";

const Public = () => {
  return (
    <div className="flex">
      <div className="grid-cols-3">
        <SidebarLeft/>
      </div>
      <div className="w-a">
        Public
        <Outlet />
      </div>
      <div className="grid-cols-3">
        <SidebarRight/>
      </div>
    </div>
  );
};

export default Public;
